import Calendar from './components/Calendar';
//import UserCreate from './components/UserCreate';
import './App.css';
import {
  Route,
  NavLink,
  HashRouter
} from "react-router-dom";

class UserCreate extends React.Component {
  constructor(props) {
      super(props);
  }
  render() {
      return(
          <div>
              <h1>Hello world</h1>
          </div>
      )
  }
}

function App() {
  return (
    <HashRouter>
    <div className="App">
      <Calendar />
      <a NavLink to="/usercreate"><p>Create User</p></a>
      <div className="content">
      <Route path="/usercreate" component={UserCreate}/>
      </div>
    </div>
    </HashRouter>
  );
}

export default App;
